import React from 'react';
import Slider from 'infinite-react-carousel';
import image1 from '../images/ads.jpg'
import '../App.css';

function Home (){
  return (

  <Slider dots>

    <img src={image1} />
    <img src={image1} />
    <img src={image1} />      
    <img src={image1} />      

  </Slider>
  );
 }
export default Home;
